script: |
  super -f text -I q429.spq | sort > q429.out

inputs:
  - name: q429.spq
    data: |
      SELECT + - col1 AS col0 FROM tab0 (FORMAT parquet) cor0 WHERE ( col0 ) / + col1 < - col2 * col2 + - col1 + + - col1 - - - 93 + + 28 + + - 27 * ( - col1 ) + col0;
  - name: tab0

outputs:
  - name: q429.out
    data: |
      -21
